from typing import List


class Solution:
    def sortedSquares(self, nums: List[int]) -> List[int]:
        n = len(nums)
        final = []
        start = 0
        end = n - 1
        for i in range(n):
            if abs(nums[start]) <= abs(nums[end]):
                final.insert(0, nums[end] * nums[end])
                end -= 1
            else:
                final.insert(0, nums[start] * nums[start])
                start += 1
        return final


